DROP SCHEMA IF EXISTS `Qjp8Kx5E0Y`;
CREATE SCHEMA `Qjp8Kx5E0Y`;
USE `Qjp8Kx5E0Y`;

CREATE TABLE `users` (
    `userId` INT NOT NULL AUTO_INCREMENT,
    `username` VARCHAR(64),
    `name` VARCHAR(64),
    `type` VARCHAR(16), -- seeker or band
    INDEX(userId), -- circumvent key problem when using AUTO_INCREMENT
    CONSTRAINT users_pk PRIMARY KEY (username)
);

