CREATE TABLE `gigs` (
    `gigId` INT NOT NULL AUTO_INCREMENT,
    `username` VARCHAR(64), -- track who posted the gig
    `title` VARCHAR(64),
    `location` VARCHAR(64),
    `postalCode` VARCHAR(64),
    `genre` VARCHAR(32),
    `songs` VARCHAR(1028),
    `budget` DECIMAL(20, 2),
    `duration` DECIMAL(20, 2), -- in hours
    `date` DATETIME,
    `noMusicians` INT,
    `description` VARCHAR(1028),
    `image` longtext,
    `status` VARCHAR(16), -- accepted, pending
    `confirmedApplicant` VARCHAR(64),

    CONSTRAINT gig_pk PRIMARY KEY (gigId)
    -- FOREIGN KEY username REFERENCES users(username)
);

